	  528217,"676",16530,2,2008,
	  "2.99 USD; 2.99 CAD",36.000,"monthly","The contents of this issue were originally announced as appearing in Superman Confidential #9 but after being displaced by reshuffling that book for the last part of \"Kryptonite\" in a press release on 2008-04-15 DC announced that that content would replace the originally-solicited contents of this issue (with a new cover).  The originally-solicited contents of this issue have yet to be published as of this writing.  The cover that was originally solicited for this issue was eventually used three years later as variant cover B on Action Comics (DC 1938 series) #900.Here's the solicitation text for the unpublished issue: \"Superman embarks on a journey with a dying man who has been in the background of the Man Of Steel's life from the very beginning. As they search for answers to the strange riddle of the man's life they also find themselves ambushed by...The Parasite!\"  This was to be written by Keith Champagne with art by Rick Leonardi and Dan Green.",
